import Tone from 'tone'

function seq1(synth) {
  let seq = new Tone.Sequence(
    function(time, note) {
      console.log(time, note)
      //straight quater notes
      synth.triggerAttackRelease()
    },
    ['C4', ['E4', 'D4', 'E4'], 'G4', ['A4', 'G4']]
  )
  return seq
}

export { seq1 }
